import { Link } from "react-router-dom";
import { footLinks, socialButtons } from "../../data/Constants";

const Footer = () => {
  return (
    <footer className="w-full bg-slate-900 text-slate-100 text-xs text-center z-20">
      <section>
        {footLinks.map((item, index) => {
          return (
            <nav>
              <ul>
                {item.links.map((link, index) => {
                  return (
                    <li>
                      <Link to={link.path}>{link.title}</Link>
                    </li>
                  );
                })}
              </ul>
            </nav>
          );
        })}
      </section>
      <ul className="mt-3 pb-3 max-w-32 mx-auto md:w-4/5 grid grid-cols-4 gap-4">
        {socialButtons.map((item, index) => {
          return (
            <li key={index}>
              <a href={item.href}>
                <i className={item.iconClass} />
              </a>
            </li>
          );
        })}
      </ul>
    </footer>
  );
};

export default Footer;
